import { useState } from "react"
import SelectButton from "../SelectButton";
import { FormWrapper } from "../FormWrapper";

type UserData = {
    duration: string
}

type Props = UserData & {
    updateFields: (fields: Partial<UserData>) => void
}


export function StepThree({ duration, updateFields }: Props) {
    const [selectedValue, setSelectedValue] = useState("");
    setSelectedValue(duration)

    return (
        <FormWrapper title="Time">
            <p className="desc">
                How long are you looking to work out for?
            </p>
            <SelectButton info="20-30 min" selected={selectedValue === "20-30 min"} onSelect={() => setSelectedValue("20-30 min")} />
            <SelectButton info="30-50 min" selected={selectedValue === "30-50 min"} onSelect={() => setSelectedValue("30-50 min")} />
            <SelectButton info="60 min +" selected={selectedValue === "60 min +"} onSelect={() => setSelectedValue("60 min +")} />
        </FormWrapper>
    )
}
